description:
Incluye los dlc zombies con todos los mapas de zombies solamente offline 
tiene que ser obligatorio el call of duty black ops version skidrow 
para jugar solo en el menu presionan las siguientes teclas:

bind F1  &quot;map zombie_theater&quot;               
bind F2  &quot;map zombie_pentagon&quot;             
bind F3  &quot;map zombietron&quot;
bind F4  &quot;map zombie_cod5_prototype&quot;
bind F5  &quot;map zombie_cod5_asylum&quot;
bind F6  &quot;map zombie_cod5_sumpf&quot;
bind F7  &quot;map zombie_cod5_factory&quot;
bind F8  &quot;map zombie_cosmodrome&quot;
bind F9  &quot;map zombie_coast&quot;
bind F10 &quot;map zombie_temple&quot;
bind F11 &quot;map zombie_moon&quot;
